DROP TABLE IF EXISTS `brand`;
CREATE TABLE `brand`(
    `Id`     bigint       NOT NULL AUTO_INCREMENT COMMENT '品牌id',
    `name`   varchar(255) DEFAULT NULL COMMENT '品牌名称',
    `image`  varchar(255) DEFAULT NULL COMMENT '品牌图片地址',
    `letter` varchar(255) DEFAULT NULL COMMENT '品牌的首字母',
    PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='品牌表';
